import React, { Component } from 'react';

class NotificationsPanel extends Component {
  render() {
    return (
      <div className={'NotificationsPanel'}>
        <div style={{ fontWeight: 600 }}>no notifications</div>
      </div>
    );
  }
}

export default NotificationsPanel;
